import React from 'react';
import { Map, Layer, ImageOverlay } from 'react-map-gl';

const MapWithImageOverlay = () => {
  return (
    <Map
      mapboxAccessToken="YOUR_MAPBOX_ACCESS_TOKEN" // Replace with your Mapbox access token
      initialViewState={{
        longitude: 106.6409, // Center longitude
        latitude: 10.8536, // Center latitude
        zoom: 12, // Zoom level
      }}
    >
      <Layer type="image" id="image-overlay">
        <ImageOverlay
          url="https://drive.google.com/file/d/1-f86SdvhaxBQwwGOiedRa-ZE4k9W3bWZ/view" // Replace with URL of your map image
          bounds={[10.9, 10.8, 106.6, 106.7]} // Image bounds
          opacity={0.5} // Image opacity
        />
      </Layer>
    </Map>
  );
};

export default MapWithImageOverlay;
